import { expect } from "chai";
import getImportDefault from "../getImportDefault.mjs";
describe("Test getImportDefault", function () {
  it("default @ level 2", function () {
    var o = {
      default: {
        default: "l2"
      }
    };
    expect(getImportDefault(o)).to.equal("l2");
  });
  it("default @ level 1", function () {
    var o = {
      default: "l1"
    };
    expect(getImportDefault(o)).to.equal("l1");
  });
  it("test return obj", function () {
    var o = "o";
    expect(getImportDefault(o)).to.equal("o");
  });
});